import React, { Component } from "react";

class TopStock extends Component {
    constructor(props) {
        super(props);
        this.state = {
            isShow: true,
        };
    }


    toggleShow = () => {
        this.setState(state => ({ isShow: !state.isShow }));
    };

    render() {
        return (
            <div>
                {this.props.map((ticker, delta) => (
                    <p>
                    {ticker} ({delta})
                    </p>
                ))}
            </div>
        );
    }
}

export {
    TopStock
}
